contracts/FarmNetOrder.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract FarmNetOrder {
    struct Order {
        uint256 id;
        address buyer;
        address farmer;
        string productName;
        uint256 amount;
        uint256 timestamp;
        string status; // "Placed", "Delivered", etc.
    }

    uint256 public orderCount;
    mapping(uint256 => Order) public orders;

    event OrderPlaced(
        uint256 id,
        address indexed buyer,
        address indexed farmer,
        string productName,
        uint256 amount,
        uint256 timestamp
    );

    event OrderStatusUpdated(uint256 indexed id, string status);

    function placeOrder(address _farmer, string memory _productName, uint256 _amount) public {
        require(_farmer != address(0), "Invalid farmer address");
        require(_amount > 0, "Amount must be greater than zero");

        orderCount++;
        orders[orderCount] = Order({
            id: orderCount,
            buyer: msg.sender,
            farmer: _farmer,
            productName: _productName,
            amount: _amount,
            timestamp: block.timestamp,
            status: "Placed"
        });

        emit OrderPlaced(orderCount, msg.sender, _farmer, _productName, _amount, block.timestamp);
    }

    function updateOrderStatus(uint256 _id, string memory _status) public {
        Order storage order = orders[_id];
        require(order.farmer == msg.sender, "Only farmer can update status");
        order.status = _status;
        emit OrderStatusUpdated(_id, _status);
    }

    function getOrder(uint256 _id) public view returns (Order memory) {
        require(_id > 0 && _id <= orderCount, "Invalid order ID");
        return orders[_id];
    }
}

contracts/OrderVerifier.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract OrderVerifier {
    mapping(string => bool) public verifiedOrders;

    event OrderVerified(address indexed verifier, string orderId, string details);

    function verifyOrder(string memory orderId, string memory details) public {
        require(!verifiedOrders[orderId], "Order already verified");
        verifiedOrders[orderId] = true;
        emit OrderVerified(msg.sender, orderId, details);
    }

    function isVerified(string memory orderId) public view returns (bool) {
        return verifiedOrders[orderId];
    }
}

contracts/ProductTracking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract ProductTracking {
    struct Product {
        uint256 id;
        string name;
        string origin;
        address farmer;
        address consumer;
        bool delivered;
        string currentLocation;
        string status; // "Harvested", "In Transit", "Delivered"
        uint256 timestamp;
    }

    uint256 public productCount;
    mapping(uint256 => Product) public products;

    event ProductAdded(uint256 id, string name, string origin, address indexed farmer);
    event ProductUpdated(uint256 id, string location, string status, address indexed updater);
    event ProductDelivered(uint256 id, address indexed consumer);

    function addProduct(string memory _name, string memory _origin) public {
        require(bytes(_name).length > 0, "Product name required");
        require(bytes(_origin).length > 0, "Product origin required");

        productCount++;
        products[productCount] = Product({
            id: productCount,
            name: _name,
            origin: _origin,
            farmer: msg.sender,
            consumer: address(0),
            delivered: false,
            currentLocation: _origin,
            status: "Harvested",
            timestamp: block.timestamp
        });

        emit ProductAdded(productCount, _name, _origin, msg.sender);
    }

    function updateProduct(uint256 _id, string memory _location, string memory _status) public {
        Product storage product = products[_id];
        require(product.farmer == msg.sender, "Only farmer can update");
        product.currentLocation = _location;
        product.status = _status;
        product.timestamp = block.timestamp;
        emit ProductUpdated(_id, _location, _status, msg.sender);
    }

    function markDelivered(uint256 _id, address _consumer) public {
        Product storage product = products[_id];
        require(product.farmer == msg.sender, "Only farmer can mark delivered");
        product.consumer = _consumer;
        product.delivered = true;
        product.status = "Delivered";
        emit ProductDelivered(_id, _consumer);
    }

    function getProduct(uint256 _id) public view returns (Product memory) {
        require(_id > 0 && _id <= productCount, "Invalid product ID");
        return products[_id];
    }
}

